  `org_fax` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `org_tax_code` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `org_current_version` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
